import React from 'react'
import { Container, Row } from 'reactstrap'
// import Custom Components
import CardWrapper from "../../../containers/blog/card/grid-wrapper"
import { BlogsData } from "../../../database/blog/database"

const Articlesgrid = ({ }) => (
    <section className="agency blog blog- pt-0">
        <Container className="no-side">
            <Row>
                {BlogsData.length > 0 ?
                    BlogsData.map((item, index) =>
                        <CardWrapper
                            key={`grid-no-sidebar-${index}`}
                            className="col-xl-12 col-md-12 mb-3"
                            image={item.image}
                            blogDate={item.createdAt}
                            place={item.place}
                            title={item.title}
                            description={item.description}
                            readUrl={item.readUrl}
                        />
                    ) :
                    '!! No Blogs Found'}
            </Row>
        </Container>
    </section>
)


export default Articlesgrid;
